<!DOCTYPE html>
<html>
<head>
  <title>mew.design</title>
  <style>
    html, body {
      height: 100%;
      margin: 0;
      display: flex;
      flex-direction: column;
    }

    .container {
      flex: 1; /* Take up remaining vertical space */
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
    }

    .centered-image {
      display: flex;
      justify-content: center;
      align-items: center;
      width: 200px;
      height: 200px;
      border-radius: 50%;
      overflow: hidden;
    }

    .centered-image img {
      max-width: 100%;
      max-height: 100%;
    }

    /* Light mode styles */
    body {
      --background-color: #d4d4d4;
      --text-color: #020617;
    }

    /* Dark mode styles */
    @media (prefers-color-scheme: dark) {
      body {
        --background-color: #020617;
        --text-color: #ffffff;
      }

      a:visited { color: #ffffff; }
    }

    body {
      background-color: var(--background-color);
      color: var(--text-color);
    }

    /* Footer styles */
    .footer {
      font-size: 12px;
      text-align: center;
    }

  </style>
</head>
